INSERT INTO `cc_board` (`bno`, `title`, `content`, `writer`, `regdate`, `updatedate`) VALUES
	(1, '환불은 어떻게 받나요?', '환불은 최초 고객님께서 결제를 하셨던 방법대로 환불됩니다. ※ 카드결제 후 현금으로 환불 받으실 수는 없습니다. ', 'admin', '2023-02-07 16:49:19', '2023-02-07 16:49:19'),
	(2, '탁송이 가능한가요?', '네, 탁송 가능하십니다.\r\n왕복 탁송료, 탁송으로 인해 발생되는 왕복 유류비는 고객님 부담 입니다.\r\n', '관리자', '2023-02-08 09:35:53', '2023-02-08 09:35:53'),
	(3, ' 반려동물 동반 가능한가요?', '캠핑카 내부에 반려동물 동반은 불가 합니다.위반 시 실내 크리닝 비용 및 휴차료 비용을 청구 합니다.', '관리자', '2023-02-08 09:36:19', '2023-02-08 09:36:19'),
	(4, '하루 연장하려면 어떠헤 해야하나요?', '약속된 반납시간 이전에 계약지접 및 담당자에게 통보하여야 하며 사전 동의 없이 임의로 연장해버리는 경우 보험 및 보상을 받으실 수 없습니다.', '관리자', '2023-02-08 10:56:21', '2023-02-08 10:56:21'),
	(5, '예약을 했는데 취소하게 될 경우 어떻게 하나요?', '대여일 24시간 이전 → 전액환불 / 대여일 24시간 이내 → 환불 불가', '관리자', '2023-02-08 10:56:21', '2023-02-08 10:56:21'),
	(6, '2명이 운전자로 등록 할 수 있나요?', '계약서상의 제1운전자, 제2운전자 기입이 가능하며 별도의 추가비용은 없습니다. 계약자 이외의 제3자가 운전할 경우 보험 및 보상을 받으실 수 없습니다.', '관리자', '2023-02-08 10:56:21', '2023-02-08 10:56:21'),
	(7, '유류비는 어떻게 계산되나요?', '연료비는 전액 사용자 부담이며 차량대여 시 직원과 함께 체크하여 기존 양 만큼 동일하게 반납해주시면 됩니다. 기존양보다 적을 경우 실비 정산하여 담당자에게 지불하시면 됩니다.', '관리자', '2023-02-08 10:56:21', '2023-02-08 10:56:21'),
	(8, '만26세 이하는 대여가 안되나요?', '만 26세 이상, 운전경력 1년 이상 된 고객님들만 대여가 가능 하십니다.\r\n', '관리자', '2023-02-08 09:36:44', '2023-02-08 09:36:44'),
	(9, '화장실 보증금은 환불 해 주시나요?', '캠핑 하시는 동안 사용하셨던 변기 오물통을 반납시 깨끗하게 비워주시면 환불 해 드립니다.\r\n단, 오물통을 비우지 않은 상태로 반납 하시게 될 경우 보증금은 돌려드리지 않습니다.', '관리자', '2023-02-08 09:37:01', '2023-02-08 09:37:01'),
	(10, '대여시간을 알고 싶어요', '출차 및 반납 가능 시간은 오전 10시 ~ 오후 4시이고 출차 및 반납 가능 시간 이외의 시간에 출차 및 반납할 경우엔 과태료가 벌생합니다.\r\n\r\n모든 차량은 1박 24시간 기준이고 시간 추가도 가능합니다 \r\n\r\n단 미리 시간 추가를 하지 않을 경우 뒤에 예약이 있으면 시간 추가가 불가할 수도 있는 점 양해 부탁드립니다', '관리자', '2023-02-08 09:41:26', '2023-02-08 09:41:26'),
	(11, '대여 시 가져가는 차량 주차 가능한가요?', '가져오시는 차량은 출고하는 주차장에 무료주차 1대 가능합니다', '관리자', '2023-02-08 09:42:10', '2023-02-08 09:42:10'),
	(12, '차량에 하이패스 달려있나요?', '모든 차량에 하이패스가 장착되어 있으니 카드만 챙겨 오시면 됩니다:)', '관리자', '2023-02-08 09:42:30', '2023-02-08 09:42:30'),
	(13, '차량 스펙이 어떻게 되나요?', '자세한 내용은 보유차량을 봐주시기 바랍니다.', '관리자', '2023-02-08 09:44:07', '2023-02-08 09:44:07'),
	(14, '제휴 문의후  승인에 관한 문의입니다.', '신청하신 이후 최대 3일 정도의 심사기간이 예상되며, 킥오프 미팅을 진행한 이후 정상이용이 가능합니다.', '관리자', '2023-02-08 10:48:34', '2023-02-08 10:48:34'),
	(15, '제휴프로그램 유입사용자는 신규회원만 해당되나요?', '네 그렇습니다. 제휴 프로그램 유입사용자로 집계가 되는 사용자는 스윙에 처음 가입한 신규회원들만 해당됩니다.', '관리자', '2023-02-08 10:56:21', '2023-02-08 10:56:21'),
	(16, '전기는 AC인가요 DC인가요?', '전등,조명등은 DC(직류)이며 그 외 가전제품 등 대부분 AC(교류)입니다. ', '관리자', '2023-02-08 10:59:25', '2023-02-08 10:59:25'),
	(17, '전기로 인한 화재위험은 없나요?', '전기배선에 있어서도 일반적인 기준보다 더 두꺼운 3.5스퀘어 전선을 사용하고 있어서 전기로 인한 화재위험이 거의 없습니다. ', '관리자', '2023-02-08 10:59:25', '2023-02-08 10:59:25'),
	(18, '자바캠핑카 고장력타이어 교체', '안녕하세요 자바캠핑카 입니다.\r\n\r\n캠핑카 타이어를 고장력타이어로 교체하였습니다.\r\n\r\n더이상 타이펑크에 불안해 하지 않으셔도 됩니다.', '관리자', '2023-02-16 10:52:26', '2023-02-16 10:52:26'),
	(19, '캠핑장정보 어디서찾으세요?', '캠핑카이용시필요하신 식수및페수처리에이용하시고 전기및화롯데사용등 노지캠핑에불편하신분들참고하세요.~\r\n\r\nhttps://www.gocamping.or.kr/\r\n\r\n대한민국 구석구석 go camping\r\n\r\n \r\n\r\n무료캠핑장\r\n\r\n전기 및 샤워는 기본적으로 안 됩니다. \r\n\r\n무료캠핑장이니 우리모두 깨끗하게 사용합시다.\r\n\r\n수도권\r\n\r\n경기도 양평군 서종면 도장리 94 (도장계곡 자연 발생 유원지) (입구에서 1만원 받음 사유지, 전기 X, 개수대 X, 푸세식)\r\n\r\n경기도 안성시 양성면 산정리 240-3 (양성 산림욕장)\r\n\r\n경기도 양평군 용문면 광탄리 235-8 (광탄 유원지) 성수기는 입장료 2000원받는걸로 알고있구요. 경치 너무 좋음. 화장실 깨끗!\r\n\r\n광탄유원지 캠핑장 참고 >>>> http://kimssine.tistory.com/8\r\n\r\n경기도 남양주시 수동면 수산리 133 (수산리 우리마을 힐링캠프) \r\n\r\n경기도 평택시 오성면 양교리 751-1 (스노우라인오토캠핑장)  031-683-8307 전화문의필수.\r\n\r\n경기도 포천시 영북면 산정리 187 (산정호수캠핑장) \r\n\r\n\r\n\r\n 강원도\r\n\r\n강원도 원주시 신림면 성남리 261-1번지 (아랫당숲 야영장)     \r\n\r\n강원도 횡성군 청일면 유동리 1445 (농거리야영장)  - 재래식, 개수대 부족, 여름이외에는 조용함\r\n\r\n강원도 횡성군 갑천면 병지방리 539번지 (병지방 오토캠핑장)  \r\n\r\n강원도 춘천시 남면 발산리 832번지 (소남이섬 야영장)  - 2014년. 06월 폐쇄.  무분별한 쓰레기, 화롯대 등  \r\n\r\n강원도 홍천군 서면 어유포리 272번지(팔봉산관광지 - 팔봉산오토캠핑장)   - 데크시설, 사람무지많음   \r\n\r\n강원도 태백시 소도동 322-3번지 (당골 야영장)    \r\n\r\n강원도 인제군 남면 갑둔리 217-6 (쌍다리야영장)\r\n\r\n강원도 화천군 간동면 구만리  1313-1 (딴산유원지야영장) - 전기유료(매점것 사용), 개수대 있으나 식수는 추천하지 않음, 화장실 있슴.  \r\n\r\n강원도 설악산 설악동오통캠핑장 (입장료 1인 2,000, 주차료 5,000) \r\n\r\n강원도 평창군 평창읍 중리 8-3 번지 (평창바위공원캠핑장) (무료)  패러글라이딩출발지, 하일계곡, 다수리돌탑, 뇌운계곡\r\n\r\n강원도 정선군 신동읍 고성리 산17번지 (동강전망자연휴양림캠핑장) 2만원, 1만원 40개 데크,  donggang.jsimc.or.kr  , 정선5일장 (2, 7일) \r\n\r\n강원도 홍천군 서면 모목리 523-3 (모곡밤벌유원지) ​- 오지캠핑 \r\n\r\n강원도 원주시 지정면 간현리 1056-5 (간현유원지캠핑장) ​- 오지캠핑 \r\n\r\n강원도 춘천시 남산면 산수리 470-11 (산수리마을휴양지) - 오지캠핑 \r\n\r\n강원도 정선군 여량면 유천리 574번지 (흥터마을관리 유원지) ​ \r\n\r\n \r\n\r\n 충청도\r\n\r\n충남 서산시 대산읍 화곡리 2-24번지(삼길포항)     \r\n충남 금산군 제원면 천내리 256번지(기러기 공원)  \r\n\r\n충북 음성군 원남면 조촌리 411 번지 (원남저수지 원남테마공원캠핑장)  - 사이트 잘 갖쳐줘 있슴. 화장실 개수대있고 분리수거 음식물쓰레기장 있음  <2016년6월달부터 몇달간공사한다고했는데 확인하고가세요~)\r\n\r\n충북 청주시 흥덕구 원평동 100번지(문암 생태공원) 화장실 o 개수대  o 쓰레기장.음식물.분리수거  o\r\n\r\n충북 충주시 산척면 명서리 390번지 (삼탄 유원지) \r\n\r\n충북 충주시 대소원면 문주리 (수주팔봉야영지) -화장실, 개수대 있슴.\r\n\r\n수주팔봉야영지 캠핑장 참고 >>> http://kimssine.tistory.com/52\r\n\r\n충북 청원군 미원면 대덕리 266-1