	(20, '무시동 히터 기름 많이 들어가나요?', '무시동 히터 가동 시 시간당 0.3리터 정도 연료를 소모하여 거의 사용하지 않는다고 보시면 됩니다', '관리자', '2023-02-16 10:55:41', '2023-02-16 10:55:41'),
	(21, '전기장치중에 \'인버터\' 라는 장치는 왜 필요한가요?', '일종의 전력변환장치로 차량에서 사용되는 배터리는 DC(직류)12V를 주로 사용하지만, 캠핑카에서 전자제품을 사용할 경우,\r\n220V의 AC(교류)가 필요하기 때문에 인버터라는 장치를 통해 전력을 변환하여 사용합니다.\r\n\r\n\r\n\r\n인버터를 켜지 않은 상황에서는 DC(직류)만 흐르기 때문에, 아무리 컨센트를 꽂아도 AC(교류)를 사용하는 전자기기가\r\n작동하지 않습니다.\r\n\r\n보통의 차량용 인버터의 경우, 총 가동전력의 70~80%정도를 출력할 수 있습니다. 그래서 캠핑카처럼 전력의 소모가 많은 경우,\r\n최소 3000W(3KW) 이상의 인버터를 설치하는게 일반적입니다.\r\n\r\n\r\n외부 전원 연결시, 인버터 작동 여부와 관계없이 220V의 전기를 사용할 수 있습니다.\r\n\r\n캠핑카의 운행중, 에어컨 및 난방기기, 전기장치는 웬만하면 사용을 자제해야 합니다. 고장이나 오작동의 원인이 될 수 있으니 \r\n\r\n이 점 유의하셔서 사용하시면 좀 더 오랫동안 고장없이 사용이 가능합니다.\r\n\r\n\r\n인버터의 종류\r\n\r\n‘순수정현파’ 와 ‘유사정현파’ 가 있는데, 순수한 전기의 파동을 유사하게 구현한 것이 ‘유사정현파＇이고\r\n‘순수정현파’는 한전의 파동과 같습니다. 정밀한 전자제품이나 모터가 작동하는 제품, 전기장판 등은 순수정현파로 변환된 전기를\r\n사용해야만 안전율이 올라갑니다.', '관리자', '2023-02-16 10:58:00', '2023-02-16 10:58:00');
